import React, { Component } from 'react';

class BuscarProducto extends Component {
    render() {
        return (
            <div className="col-12">
                <div className="card">
                    <div className="card-body">
                        <h5 class="card-title">Buscador de Productos</h5>

                    </div>

                </div>
            </div>
        );
    }
}

export default BuscarProducto;
